import React from 'react';
import Grid from '@mui/material/Grid';
import Typography from '@mui/material/Typography';
import Paper from '@mui/material/Paper';


function Home() {
    return (
        <Grid
            container
            flexDirection="row"
            justifyContent="space-around"
        >
            <Grid item>
                <Typography>
                    Hi, I'm 
                </Typography>
                <Paper
                    elevation={10}
                >
                    <Typography
                        sx={{
                            fontFamily: "Abel",
                            fontSize: "32px",
                            lineHeight: "48px",
                            fontWeight: "900",
                            '&:hover': {
                                textShadow: "0px 0px 5px red"
                            },
                        }}
                    >
                        C
                    </Typography>
                    <Typography
                        sx={{
                            fontFamily: "Abel",
                            fontSize: "32px",
                            lineHeight: "48px",
                            fontWeight: "900",
                            '&:hover': {
                                textShadow: "0px 0px 5px orange"
                            },
                        }}
                    >
                        H
                    </Typography>
                    <Typography
                        sx={{
                            fontFamily: "Abel",
                            fontSize: "32px",
                            lineHeight: "48px",
                            fontWeight: "900",
                            '&:hover': {
                                textShadow: "0px 0px 5px yellow"
                            },
                        }}
                    >
                        A
                    </Typography>
                    <Typography
                        sx={{
                            fontFamily: "Abel",
                            fontSize: "32px",
                            lineHeight: "48px",
                            fontWeight: "900",
                            '&:hover': {
                                textShadow: "0px 0px 5px green"
                            },
                        }}
                    >
                        R
                    </Typography>
                    <Typography
                        sx={{
                            fontFamily: "Abel",
                            fontSize: "32px",
                            lineHeight: "48px",
                            fontWeight: "900",
                            '&:hover': {
                                textShadow: "0px 0px 5px blue"
                            },
                        }}
                    >
                        L
                    </Typography>
                    <Typography
                        sx={{
                            fontFamily: "Abel",
                            fontSize: "32px",
                            lineHeight: "48px",
                            fontWeight: "900",
                            '&:hover': {
                                textShadow: "0px 0px 5px indigo"
                            },
                        }}
                    >
                        I
                    </Typography>
                    <Typography
                        sx={{
                            fontFamily: "Abel",
                            fontSize: "32px",
                            lineHeight: "48px",
                            fontWeight: "900",
                            '&:hover': {
                                textShadow: "0px 0px 5px violet"
                            },
                        }}
                    >
                        E
                    </Typography>
                </Paper>
                <Typography>
                    I'm a graduate student at Georgia Tech pursuing an M.S. in Computer Science. I have a B.S. in Biomedical Engineering from Ohio State and am an experienced Product Design Engineer and Product Manager.
                </Typography>
            </Grid>
            <Grid item>Also Home</Grid>
        </Grid>
    );
}

export default Home;
